val output = document.getElementById("output")!! as HTMLDivElement
val audioCtx:dynamic = js("new AudioContext()")
var soundEnabled = true

const val CARRIED = 0xfe
const val WORN = 0xfd
const val NOT_CREATED = 0xfc

class GameState(g: GameData) {
    lateinit var objectPositions: MutableList<Int>
    lateinit var flags: Array<Int>
    var location = 0

    val isDark
        get() = flags[0] != 0

    var nCarried
        get() = flags[1]
        set(value) { flags[1] = value }

    val score
        get() = flags[30]

    var turns
        get() = flags[31] + 256 * flags[32]
        set(value) {
            flags[31] = value % 256
            flags[32] = value / 256
        }

    init {
        reset(g)
    }

    fun reset(g: GameData) {
        flags = Array(33) {0}
        location = 0
        objectPositions = g.initialObjectPositions.toMutableList()
    }

    fun decreaseFlag(flagNo: Int) {
        if (flags[flagNo] > 0)
            flags[flagNo]--
    }

    fun save(name: String, then: () -> Unit) {
        val state = byteArrayOf(
            location.toByte(),
            *flags.map { it.toByte() }.toByteArray(),
            *objectPositions.map { it.toByte() }.toByteArray())
        val blob = Blob(arrayOf(state), BlobPropertyBag("application/octet-stream"))
        val anchor = document.createElement("a") as HTMLAnchorElement
        anchor.href = URL.createObjectURL(blob)
        anchor.download ="$name.state"
        document.body?.appendChild(anchor)
        anchor.click()
        document.body?.removeChild(anchor)
        then()
    }

    fun load(then: () -> Unit) {
        val uploadButton: dynamic = document.getElementById("fileid")
        uploadButton.value = ""
        uploadButton.onchange = { event: dynamic ->
            val reader = FileReader()
            reader.onload = onload@{
                val buff = (reader.result as String).map { it.toInt() }
                location = buff.get(0)
                flags = buff.slice(1..33).toTypedArray()
                objectPositions = buff.slice(34..34+objectPositions.size-1).toMutableList()
                then()
            }
            reader.readAsBinaryString(event.target.files[0])
        }
        uploadButton.click()
    }
}

fun objIsPresent(d: GameState, objNo: Int) =
    d.objectPositions[objNo] in listOf(d.location, WORN, CARRIED)

fun Condition.check(d: GameState) =
    when (opCode) {
        0 -> d.location == param1
        1 -> d.location != param1
        2 -> d.location > param1
        3 -> d.location < param1
        in 4..9 -> d.objectPositions[param1].let { objPos -> when (opCode) {
            4 -> objIsPresent(d, param1)
            5 -> !objIsPresent(d, param1)
            6 -> objPos == WORN
            7 -> objPos != WORN
            8 -> objPos == CARRIED
            9 -> objPos != CARRIED
            else -> false
        }}
        10 -> 100 * random() < param1
        in 11..15 -> d.flags[param1].let { flag -> when (opCode) {
            11 -> flag == 0
            12 -> flag != 0
            13 -> flag == param2
            14 -> flag > param2
            15 -> flag < param2
            else -> false
        }}
        else -> false
    }


fun printOut(msg: String, then: () -> Unit) {
    output.innerHTML += "<p>$msg</p>"
    then()
}

fun updateLocation(g: GameState, d: GameData, runProcesses: Boolean, then: () -> Unit) {
    fun printInventory() {
        val here = g.objectPositions
            .withIndex()
            .filter { it.value == g.location }
            .map { d.objects[it.index] }
        if (here.isNotEmpty()) {
            printOut(
                if (here.size == 1) "Vidim tudi ${here.first()}."
                else "Vidim tudi:<br>" + here.joinToString("") { "- $it<br/>" },
                then
            )
        } else {
            then()
        }
    }

    output.innerHTML = ""
    g.decreaseFlag(2)
    if (g.isDark) {
        g.decreaseFlag(3)
        if (!objIsPresent(g, 0))
            g.decreaseFlag(4)
        printOut("Temno je kot v rogu.", {
            if (runProcesses) d.processes.process(g, d, finally={ then() })
            else then()
        })
    } else {
        printOut(d.locations[g.location]) {
            if (runProcesses)
                d.processes.process(g, d) {
                    printInventory()
                }
            else
                printInventory()
        }
    }
}


fun beep(duration: Int, pitch: Int, then: () -> Unit) {
    if (duration > 10 && !soundEnabled)
        return then()
    val freq = 440 * (1.059463094359).pow(pitch / 2 - 69)
    var oscillator = audioCtx.createOscillator()
    oscillator.type = "square"
    oscillator.connect(audioCtx.destination)
    oscillator.frequency.setValueAtTime(freq, audioCtx.currentTime)
    oscillator.start()
    window.setTimeout({
        oscillator.stop()
        then()
    }, 10 * duration)
}


fun Action?.execute(g: GameState, d: GameData, then: () -> Unit, done: () -> Unit) {
    if (this == null)
        return then()

    val waitKey = { block: () -> Unit ->
        document.onkeypress = { event ->
            event.stopPropagation()
            event.preventDefault()
            document.onkeypress = {}
            block()
        }
    }
    val nextBlock = { next.execute(g, d, then, done) }
    val doThis = { block: () -> Unit -> block(); nextBlock() }

    when (opCode) {
        0 -> { /* INVENTORY */
            val carrying = g.objectPositions
                .mapIndexed { i, loc ->
                    when (loc) {
                        CARRIED -> d.objects[i]
                        WORN -> "${d.objects[i]} (nosim)"
                        else -> null
                    }
                }
                .filterNotNull()
                .joinToString("") { "<li>$it</li>" }
            printOut(
                "Prenašam pa tole: ${
                if (carrying.isEmpty()) "pravzaprav nič." else "<ul>$carrying</ul>"
                }", done
            )
        }
        1 -> updateLocation(g, d, false, done)                         /* DESC */
        2 -> {
            g.reset(d); updateLocation(g, d, true, done)
        }          /* QUIT */
        3 -> waitKey { g.reset(d); updateLocation(g, d, true, done) }   /* END */
        4 -> done()                                                    /* DONE */
        5 -> printOut("OK", done)                                      /* OK */
        6 -> printOut("<span style=\"background-color: red; color: white\">Požgečkaj za nadaljevanje</span>") {
                waitKey(nextBlock) }                                    /* ANYKEY */
        7 -> g.save("kontrabant", done)                                /* SAVE */
        8 -> g.load { updateLocation(g, d, true, done)}                /* LOAD */
        9 -> printOut("Ukazov dal si ${g.turns} zares", nextBlock)     /* TURNS */
        10 -> printOut("Nabral si ${g.score} točk.", nextBlock)        /* SCORE */
        11 -> window.setTimeout(nextBlock, 20 * param1)                /* PAUSE */
        12 -> doThis { g.location = param1 }                           /* GOTO */
        13 -> printOut(d.messages[param1], nextBlock)
        14 -> if (g.objectPositions[param1] != WORN)
                  printOut("Tega sploh ne nosim.", done)
              else doThis {
                  g.objectPositions[param1] = CARRIED
              }
        15 -> {                                                        /* GET */
            val curLoc = g.objectPositions[param1]
            when {
                curLoc == WORN || curLoc == CARRIED
                    -> printOut("To vendar že nosim.", done)
                curLoc != g.location
                    -> printOut("Saj ni tukaj.", done)
                g.nCarried == d.nobjectsCarried
                    -> printOut("Toliko vendar ne morem nositi.", done)
                else -> doThis {
                    g.objectPositions[param1] = CARRIED
                    g.nCarried++
                }
            }
        }
        16 -> {                                                        /* DROP */
            val curLoc = g.objectPositions[param1]
            if ((curLoc != WORN) && (curLoc != CARRIED)) {
                printOut("Tega sploh nimam.", done)
            } else doThis {
                g.objectPositions[param1] = g.location
                g.nCarried--
            }

        }
        17 -> {                                                        /* WEAR */
            val curLoc = g.objectPositions[param1]
            when {
                curLoc == WORN
                    -> printOut("To vendar že nosim.", done)
                curLoc != CARRIED
                    -> printOut("Tega sploh nimam.", done)
                else
                    -> doThis {
                        g.objectPositions[param1] = WORN
                 }
            }
        }
        18 -> doThis {
            /* DESTROY */
            val curLoc = g.objectPositions[param1]
            if ((curLoc == WORN) || (curLoc == CARRIED))
                g.nCarried--
            g.objectPositions[param1] = NOT_CREATED
        }
        19 -> doThis {
            /* CREATE */
            val curLoc = g.objectPositions[param1]
            if ((curLoc == WORN) || (curLoc == CARRIED))
                g.nCarried--
            g.objectPositions[param1] = g.location
        }
        20 -> doThis {
            /* SWAP */
            val t = g.objectPositions[param1]
            g.objectPositions[param1] = g.objectPositions[param2]
            g.objectPositions[param2] = t
        }
        21 -> doThis { g.flags[param1] = 255 }                         /* SET */
        22 -> doThis { g.flags[param1] = 0 }                           /* CLEAR */
        23 -> doThis {
            /* PLUS */
            g.flags[param1] += param2
            if (g.flags[param1] > 255)
                if (param1 > 47) {
                    g.flags[param1] -= 256
                    g.flags[param1 + 1] = (g.flags[param1 + 1] + 1) % 256
                } else {
                    g.flags[param1] = 255
                }
        }
        24 -> doThis {
            /* MINUS */
            g.flags[param1] -= param2
            if (g.flags[param1] < 0)
                if (param1 > 47) {
                    g.flags[param1] += 256
                    g.flags[param1 + 1]--
                    if (g.flags[param2 + 1] == -1) {
                        g.flags[param2 + 1] = 0
                    }
                } else {
                    g.flags[param1] = 255
                }
        }
        25 -> doThis {
            /* LET */
            g.flags[param1] = param2
        }
        26 -> beep(param1, param2, nextBlock)                          /* BEEP */
        else -> done()                                                 /* invalid */
    }
}


fun Command?.process(
    g: GameState, d: GameData, word1: Int = 255, word2: Int = 255,
    matched: Boolean = false, finally: (Boolean) -> Unit
): Unit =
    when {
        this == null
            -> finally(matched)
        (word1 == this.word1) && (word2 == this.word2) && conditions.all { it.check(g) }
            -> action.execute(
                g, d,
                { next.process(g, d, word1, word2, true, finally) },
                { finally(true) }
            )
        else
            -> next.process(g, d, word1, word2, matched, finally)
    }


fun userCommand(rawText: String, g: GameState, d: GameData, then: () -> Unit) {
    when (rawText.split(' ')[0].take(4).toUpperCase()) {
        "SHRA", "SAVE"
            -> return g.save(rawText.split(' ', limit=2).getOrNull(1)?:"kontrabant", then)
        "NALO", "LOAD"
            -> return g.load { updateLocation(g, d, true, then) }
    }

    val text = rawText.trim().toUpperCase()
    if (text.isEmpty())
        return then()

    for(flagNo in 5..8)
        g.decreaseFlag(flagNo)
    if (g.isDark) {
        g.decreaseFlag(9)
        if (!objIsPresent(g, 0))
            g.decreaseFlag(10)
    }

    printOut("<font color=\"yellow\"/>&gt;&nbsp;$text</font>") print@{
        g.turns++
        val words = text
            .split(' ')
            .map { it.trim().take(4) }
            .mapNotNull { d.vocabulary[it] }
        if (words.isEmpty()) {
            return@print printOut("Tega sploh ne razumem. Poskusi povedati kako drugače.", then)
        }
        val dest = d.connections[g.location][words[0]]
        if (dest != null) {
            g.location = dest
            updateLocation(g, d, true, then)
        } else {
            val finally = { d.processes.process(g, d) { then() } }
            d.responses.process(g, d, words[0], words.getOrElse(1) { 255 }) { matched ->
                if (!matched)
                    printOut(
                        if ((words.size == 1) && (words[0] < 16))
                            "Mar ne vidiš, da v to smer ni poti?"
                        else "Tega pa ne morem.",
                        finally
                    )
                else finally()
            }
        }
    }
}


val command = document.getElementById("command")!! as HTMLInputElement
val inputdiv = document.getElementById("inputdiv")!! as HTMLDivElement
val loadsave: dynamic = document.getElementById("loadsave")

fun main(args: Array<String>) {
    val tap = ""
    val memory = intArrayOf(*IntArray(16384 - 27) { 0 },
        *tap
            .chunked(2)
            .map { it.toInt(16) }
            .toIntArray())

    val gameData = GameData(memory)
    val gameState = GameState(gameData)

    fun preventCommands() {
        inputdiv.setAttribute("style", "visibility: hidden")
        loadsave.setAttribute("style", "visibility: hidden")
    }

    fun enableCommands() {
        command.value = ""
        inputdiv.setAttribute("style", "")
        loadsave.setAttribute("style", "")
        command.focus()
        window.scrollTo(0.0, document.body!!.scrollHeight.toDouble())
    }

    command.onkeypress = {
        if ((it as KeyboardEvent).keyCode == 13) {
            preventCommands()
            it.stopPropagation()
            userCommand(command.value, gameState, gameData, ::enableCommands)
        }
    }
    command.onkeyup = {
        command.value = command.value.toUpperCase().replace('Č', 'C').replace('Š', 'S').replace('Ž', 'Z')
        Unit
    }
    command.onblur = { command.focus() }

    val speaker: dynamic = document.getElementById("speaker")
    val lines: dynamic = document.getElementById("lines")
    speaker.onclick = { event: dynamic ->
        soundEnabled = !soundEnabled
        lines.setAttribute("style", if (soundEnabled) "" else "visibility: hidden")
        event.stopPropagation()
        event.preventDefault()
        command.focus()
    }

    fun connect(id: String, handler: () -> Unit) {
        val icon: dynamic = document.getElementById(id)
        icon.onclick = handler
    }
    connect("save") { gameState.save("kontrabant", ::enableCommands) }
    connect("load") { gameState.load { updateLocation(gameState, gameData, true, ::enableCommands) } }

    preventCommands()
    updateLocation(gameState, gameData, true, ::enableCommands)
}